const tasks = [
  {
    id: 1,
    text: "study",
    day: "Tuesday",
    reminder: false,
  },
  {
    id: 2,
    text: "gym",
    day: "Saturday",
    reminder: true,
  },
  {
    id: 3,
    text: "work",
    day: "Monday",
    reminder: true,
  },
];

const Tasks = () => {
  return (
    <>
      {tasks.map((task) => {
        return (
          <>
            <h3>{task.text}</h3>
            <h6>{task.day}</h6>
          </>
        );
      })}
    </>
  );
};

export default Tasks;
